import React from "react";

const Group = () => {
  return (
    <div className="relative flex items-center justify-center w-full h-screen bg-gray-50">
      {/* Container for the video and content */}
      <div className="relative w-full h-full">
        {/* Video Background */}
        <div className="absolute inset-0 z-0">
          <video
            src="https://framerusercontent.com/assets/IFm1iCq5DMNEq4hsMtblkXkIWD8.mp4"
            loop
            playsInline
            autoPlay
            muted
            className="w-full h-full object-cover"
          ></video>
        </div>

        {/* Additional Layered Divs */}
        <div className="absolute inset-0 bg-transparent z-10"></div>
        <div className="absolute top-0 left-0 w-full h-full bg-opacity-10 z-20"></div>
        <div className="absolute bottom-0 right-0 w-full h-full z-30"></div>

        {/* Foreground Content */}
        <div className="relative z-40 flex items-center justify-center">
          {/* Add your foreground content here */}
          {/* <p className="text-white text-2xl font-bold">Your Content Here</p> */}
        </div>
      </div>
    </div>
  );
};

export default Group;
